import { useState } from 'react';
import '../css/explorer.css';

export const Explorer = () => {
  
  const [songs, setSongs] = useState([
    {
      id: 1,
      title: 'Blinding Lights',
      artist: 'The Weeknd',
      cover: 'data:image/jpeg;base64,', 
    },
    {
      id: 2,
      title: 'Levitating',
      artist: 'Dua Lipa',
      cover: 'data:image/jpeg;base64,',  
    },
    {
      id: 3,
      title: 'Peaches',
      artist: 'Justin Bieber',
      cover: 'data:image/jpeg;base64,', 
    }
  ]);

  return (
    <div className="container mt-5">
  <h1 className="mb-4">Explora tus gustos musicales</h1>
  <div className="row row-cols-1 row-cols-md-2 row-cols-lg-4 g-4">
    {songs.map(song => (
      <div key={song.id} className="col">
        <div className="card bg-transparent border-0 custom-card">
          <img src={song.cover} className="card-img-top img-fluid rounded" alt='Imagen-cancion' />
          <div className="card-body text-center bg-transparent">
            <h5 className="card-title text-white">{song.title}</h5>
            <p className="card-text text-white">By {song.artist}</p>
            <a href="#" className="btn btn-primary d-none play-btn">Play</a>
          </div>
        </div>
      </div>
    ))}
  </div>
</div>

  );
};